import React from "react";
import axios from "axios";

import "./Form.css";

const saveTodo = async (event) => {
    event.preventDefault();
    console.log("Clicked~");
    const URL = "/todo";
    await axios(URL, {
        method: "POST",
        data:{
            name: "Using frontend!!",
        }
    }).then(res => {
        console.log(res);
    }).catch((err) => {
        console.log(err);
    });
};

function Form() {
    return (
        <form className="form">
            <label className="label">What to do?</label>
            <input className="input" type="text"></input>
            <button className="button" type="submit" onClick={saveTodo}>
                Add Todo
            </button>
        </form>
    );
}

export default Form;
